import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';

class Heading extends Component {
    render() { 
        return ( 
            <div style={parent}>
                <img src={teamLogoImg} style={imageStyle}></img>
                
            </div>
         );
    }
}
const parent = {
    display : "inline-block"
};
const imageStyle = {
    display: "block",
    float: "left",
    width : "15%",
    height : "15%"
};
const teamLogoImg = require('./court-logo.jpg');
export default Heading;
